import SearchBar from "./SearchBar";
import NotificationIcon from "./NotificationIcon";
import Profile from "./Profile";

const MainConttainer = () => {
  return (
    <>
      <SearchBar />
      <NotificationIcon />
      <Profile />
    </>
  );
};
export default MainConttainer;
